(37, 19, 1, 1, '1024', 167, '2018-12-01 23:55:00', 0, '60', 1, 1, 0, 1, '{\"otros\": {\"Observacion\": \"El presunto autor habría visto a la víctima y a un tercero intentar sustraer una cartera. Tras ello, emprendieron una persecución en motocicleta, en la cual, uno de los ocupantes apuntaba con un arma de fuego al presunto autor, por lo que debió efectuar disparos intimidatorios.\"}}'),
(38, 61, 1, 1, '19', 171, '2018-09-21 05:30:00', 0, '40', 2, 2, 0, 1, '{\"otros\": {\"LINK\": \"http://www.diariochaco.com/noticia/un-joven-murio-apunalado-en-una-pelea-en-laguna-limpia-detuvieron-al-agresor\", \"Observacion\": \"NO SE PUDO DETERMINAR TIPOLOGÍA ATENTO A QUE EN EL PREVENTIVO SE OBSERVAN 2 VICTIMAS FALLECIDAS, EL SAT REGISTRA SOLO 1, EN LAS NOTICIAS SOLO SALE 1 VICTIMA. EL SAT DICE QUE FUE EN OCASION DE ROBO, EN EL PREVENTIVO Y EN LAS NOTICIAS NO DICE NADA DE ROBO.\"}}'),
(39, 5, 1, 1, '503', 176, '2018-12-06 15:20:00', 0, '60', 1, 1, 1, 4, '{\"otros\": {\"Observacion\": \"Víctima colateral: ZÁRATE CÉSAR (padre de la víctima).  El hermano de la víctima le habría pedido a tres de los presuntos autores que le devolvieran el celular, motivo por el cual, uno de ellos habría disparado. Tras el hecho, vecinos del lugar incendiaron la vivienda de la madre de los hermanos Suárez (presuntos autores).\"}}'),
(40, 19, 1, 1, '656', 183, '2018-08-10 21:30:00', 0, '60', 1, 1, 0, 1, '{\"otros\": {\"LINK\": \"https://www.google.com/search?q=policia+mata+a+ladron+10+de+agosto+2018+resistencia+chaco&rlz=1C1CHZN_esAR926AR962&oq=&aqs=chrome.0.69i59i450l8.4573435403j0j15&sourceid=chrome&ie=UTF-8\", \"Observacion\": \"No queda claro si hubo gatillo fácil o legítima defensa en contexto de robo. en la sentencia se absuelve al imputado, pero ello fue criticado por la Secretaría de DDHH de Chaco - https://www.chacodiapordia.com/2020/02/20/caso-follmer-un-fallo-que-da-via-libre-al-gatillo-facil-en-el-chaco/\"}}'),
