(42, 57, 1, 1, '3 b', 191, '2018-01-12 08:00:00', 0, '60', 2, 1, 0, 5, '{\"otros\": {\"LINK\": \"http://hdpnoticias.com.ar/femicidio-sauzalito-suspendieron-seis-policias-no-actuaron-tiempo/  http://www.redeco.com.ar/nacional/geneross/23440-el-triple-abandono-del-estado-a-las-mujeres-de-el-impenetrable\", \"Observacion\": \"No se activó el protocolo de búsqueda por parte del personal de la Comisaría El Sauzalito tras tomar conocimiento de la desaparición de la víctima por parte del padre, a quien no le tomaron la denuncia (el 12 de enero). Por tal accionar, fueron separados del cargo 6 policías. Según un medio de comunicación, un grupo de al menos 5 hombres la habría violado y luego asesinado. La víctima se encontraba desaparecida desde el 9 de enero, fecha en la cual fue vista en la plaza con un grupo de hombres.\"}}'),
