(1, 1, 1, 1, 7, 12, 5, 31, 3, 6, 14, 6, 4, 1, 2, 6, 6, -2, 2, -2, 2, 10, 4, 3, 7, 1, '{\"otros\": {\"Observacion\": \"La victima era un interno de la Unidad Penal 11 de Sáenz Peña.Gucetti era oriundo de la provincia de Buenos Aires y estaba purgando una pena por uso agravado de arma de fuego y robo, y llevaba varios años privado de su libertad. En el SAT se establece que la victima era un policia en servicio.\"}}'),
(2, 3, 1, 5, 7, 12, 5, 37, 3, 6, 14, 6, 4, 2, 2, 6, 6, -2, 2, -2, 2, 10, 4, 3, 7, 2, NULL),
(3, 5, 2, 9, 7, 12, 5, 18, 2, 6, 14, 6, 6, 2, 6, 6, 6, -2, 6, -2, 2, 10, 4, 3, 5, 3, '{\"otros\": {\"Observacion\": \"Fue encontrada en su domicilio con “herida cortante en región cervical anterior“.\"}}'),
(4, 7, 1, 13, 7, 9, 6, -1, 7, 6, 12, 6, 4, 2, 2, 6, 2, 0, 2, -2, 2, 10, 4, 3, 5, 4, '{\"otros\": {\"Observacion\": \"La victima era un bebé recién nacido\"}}'),
(5, 9, 1, 17, 7, 12, 5, 29, 2, 6, 14, 6, 4, 2, 2, 6, 6, -2, 2, -2, 2, 10, 4, 3, 1, 5, NULL),
(6, 13, 2, 23, 1, 2, 1, 38, 3, 6, 14, 6, 2, 2, 6, 6, 1, 2, 6, -2, 2, 10, 4, 3, 7, 6, '{\"otros\": {\"Observacion\": \"La victima tenía un pequeño empredimiento comercial de venta de ropas en el barrio Juana Azurduy de esta ciudad.\"}}'),
(7, 15, 1, 27, 7, 12, 5, 63, 5, 6, 14, 6, 6, 2, 2, 6, 6, -2, 6, -2, 2, 10, 4, 3, 5, 7, '{\"otros\": {\"Observacion\": \"Domicilio de la víctima: “Antequera (Zona del Mangal)“. Lesiones: herida cortante en cuello y tórax lado derecho.\"}}'),
